import React from 'react'

export default function Navbar() {
  return (
    <nav className="navbar navbar-dark bg-dark">
        <div className="container-fluid">
            <h1 className="navbar-brand">
              Online Code Compiler
            </h1>
        </div>
    </nav>
  )
}
